		this.playButtonOver.addEventListener("mouseover", btnJoinOver2);
		function btnJoinOver2() {		
			playBtn.isMouseOver = true;
			if (playBtn.currentFrame == 0) 
				playBtn.gotoAndPlay("over");
		};
				
		canvas.addEventListener("mouseout", btnJoinOut2);
